import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import Header from '../components/Header';
import Footer from '../components/Footer';

function SearchParking() {
    const [searchQuery, setSearchQuery] = useState('');

    // Mock parking spots data
    const parkingSpots = [
        {
            id: 1,
            name: "Central Plaza Parking",
            address: "123 Main St, Downtown",
            price: "5.00",
            available: 15,
            distance: "0.5",
            rating: 4.5
        },
        {
            id: 2,
            name: "City Mall Parking",
            address: "456 Market St, Uptown",
            price: "4.50",
            available: 8,
            distance: "0.8",
            rating: 4.2
        }
    ];

    return (
        <div className="page-container">
            <Header />
            <div className="content-container">
                <div className="search-section">
                    <div className="search-box">
                        <input
                            type="text"
                            placeholder="Search for parking location..."
                            className="search-input"
                            value={searchQuery}
                            onChange={(e) => setSearchQuery(e.target.value)}
                        />
                        <button className="search-button">
                            Search
                        </button>
                    </div>
                    <div className="filter-options">
                        <button className="filter-button">Price ↓</button>
                        <button className="filter-button">Distance ↓</button>
                        <button className="filter-button">Availability ↓</button>
                    </div>
                </div>

                <div className="parking-spots-grid">
                    {parkingSpots.map(spot => (
                        <Link to={`/parking/${spot.id}`} key={spot.id} className="parking-card">
                            <div className="parking-card-header">
                                <h3>{spot.name}</h3>
                                <span className="rating">★ {spot.rating}</span>
                            </div>
                            <p className="address">{spot.address}</p>
                            <div className="parking-card-details">
                                <span className="price">${spot.price}/hr</span>
                                <span className="available">{spot.available} spots</span>
                                <span className="distance">{spot.distance} km</span>
                            </div>
                            <button className="book-button">Book Now</button>
                        </Link>
                    ))}
                </div>
            </div>
            <Footer />
        </div>
    );
}

export default SearchParking;
